import { Modal, Row, Container, Col, Button, Form } from "react-bootstrap";
import * as Icon from "react-bootstrap-icons";

import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { createTournament } from "../redux/actions";

const DeleteConfirm = ({ visible, onhide, tournamentId }) => {
  const dispatch = useDispatch();
  const handleData = () => {
    // dispatch(createTournament(formValues));
    onhide();
  };

  const tournamentData = useSelector((state) => state.tournament.data);
  const tournament = tournamentData.find(
    (name) => name.tournament_name === tournamentId
  );
  console.log(tournament);
  return (
    <Modal
      show={visible}
      size="lg"
      onHide={onhide}
      className="modal-hieght textColor"
    >
      <Modal.Body className="py-0 mt-3 px-4">
        <Container>
          <Row>
            <h6>
              Are you sure you want to delete {tournament.tournament_name}{" "}
              tournament
            </h6>
          </Row>
          <Row className="mb-5 ">
            <div className="ml-auto">
              <Button onClick={onhide} variant="outline-primary">
                Cancel
              </Button>
              <Link to={`/backoffice/projects/overview/${tournament}`}>
                <Button
                  type="submit"
                  onClick={handleData}
                  className="primary-btn ml-3 textColor"
                >
                  <Icon.Plus size={30} />
                  Delete
                </Button>
              </Link>
            </div>
          </Row>
        </Container>
      </Modal.Body>
    </Modal>
  );
};
export default DeleteConfirm;
